_This is an early version of incognito support for Google Chrome. Only use if you want to test this early version of the feature._

Adds the _private_ property to the Browser option in handlers:

```
module.exports = {
  defaultBrowser: "Google Chrome",
  handlers: [
    {
      match: "http://example.com",
      browser: {
        name: "Google Chrome",
        private: true
      }
    }
  ]
};
```

When using this feature you need to give Finicky access to controlling Chrome: 
![image](https://user-images.githubusercontent.com/886051/67757919-fc563280-fa3c-11e9-9e9a-242289318946.png)

_Note that due to a bug it is currently not possible to open Chrome in the background (Due to this bug #71), and the incognito mode feature doesn't support it at all._

Now url handlers receive `sourceProcessPath`, a string of the path to the process that triggered Finicky. Should help with issues like #80. It's pretty new so let me know if it works for you!

```js
{
  // Open links where the path contains "Franz.app" in Safari (Experimental!)
  match({ sourceProcessPath }) {
    return sourceProcessPath.includes("Franz.app");
  },
  browser: "Safari"
}
```

Release also contains an attempted bugfix where the Finicky icon was visible in the dock in Catalina #78 (Let me know if you try it!)
